import React from 'react';
import {
    useQuery,
    useMutation,
    useQueryClient,
    QueryClient,
    QueryClientProvider,
} from 'react-query';
import { FaBook,FaRegStar,FaCaretDown,FaRegHeart} from 'react-icons/fa';
import { BiGitRepoForked } from "react-icons/bi";

const fetchRepositories = async () =>{
    const res = await fetch('https://gh-trending-api.herokuapp.com/repositories');
    return res.json();
};

const Trending = () =>{
    const {data,status} = useQuery('repositories',fetchRepositories);
    console.log(data)
    return (

        <div className="container-fluid boxes-row-trending">
            <div className="row">
                {status === 'loading' && (
                    <div className="status-data"><h4>Loading data ...</h4></div>
                )}

                {status === 'error' && (
                    <div className="status-data"><h4>Error data</h4></div>
                )}

                {status === 'success' && (
                data.result.map(repositories =>{
                    <div className="col-lg-12 box">
                        <div className="icon-row">

                            <div className="btn-group" role="group" aria-label="Button group with nested dropdown">
                                <button type="button" className="btn margin "><span className="color-s"><FaRegHeart/></span> <span className="d-none d-sm-inline">Sponsor</span></button>
                                <button type="button" className="btn border-l"><span><FaRegStar/></span> <span className="d-none d-sm-inline">star</span></button>
                                <button type="button" className="btn border-r no-padding-margin"><FaCaretDown/></button>
                            </div>

                        </div>
                        <div className="title-box">
                            <span className="ic"> <FaBook/></span>
                            <span className="desc">
                                coding-horror coding-horror / basic-computer-games
                            </span>
                        </div>
                        <div className="col-lg-9 description s1">
                            <p>An updated version of the classic "Basic Computer Games" book, with well-written examples in a variety of common programming languages</p>
                        </div>
                        <div className="box-footer">
                            <span className="ic languages">Javascript</span>
                            <span className="ic starts"> <span className="icon"><FaRegStar/></span> <span>3,051</span></span>
                            <span className="ic starts"> <span className="icon"><BiGitRepoForked/></span>405</span>
                            <span className="ic avatars"> Built by
                                <div className="all-avatars">
                                    <a className="avatar"><img src="https://avatars.githubusercontent.com/u/1522517?s=40&v=4"/></a>
                                    <a className="avatar"><img src="https://avatars.githubusercontent.com/u/1522517?s=40&v=4"/></a>
                                    <a className="avatar"><img src="https://avatars.githubusercontent.com/u/1522517?s=40&v=4"/></a>
                                    <a className="avatar"><img src="https://avatars.githubusercontent.com/u/1522517?s=40&v=4"/></a>
                                    <a className="avatar"><img src="https://avatars.githubusercontent.com/u/1522517?s=40&v=4"/></a>
                                </div>

                            </span>
                            <span className="ic today-starts"> <span className="icon"><FaRegStar/></span> <span> 400 stars today</span></span>
                        </div>

                    </div>

                })


                )}







            </div>
        </div>

    )
}
export default Trending;
